import React, { useState } from "react";
import Navbar from "../components/Navbar";
import "./APTG.css";

function APTG() {
  const [selectedCategory, setSelectedCategory] = useState("");

  const categories = {
    "Anantapur Town Day 1 All Time Records": [
      "Simha  10.63L",
      "Orange   11.65L",
      "Dookudu  14.32L",
      "Oosaravelli   17.45L",
      "Baahubali  23.74L",
      "SGS  28.63L",
      "Khaidino150   29.82L",
      "Baahubali2   53.3L",
      "RRR  85.26L",
      "Devara   92.94L",
    ],
    "Guntakal Town Top Grossers": [
      "RRR  1.31Cr",
      "Baahubali2   90.8L",
      "Baahubali   63.4L",
      "Pushpa2   63L+(17D)",
      "Devara   60L",
      "Rangasthalam  58.5L",
      "Akhanda   56.6L",
      "SyeRaa  51.6L",
      "AVPL   50.5L",
      "Pushpa   49.2L",
      "Salaar   48.74L",
      "Maharshi   48.36L",
      "KhaidiNo150  48L",
      "Kalki2898AD  46.7L",
      "KGF2   46.4L",
    ],
    "Kadapa Town Top 5 Grossers": [
      "RRR  3,14,40,812",
      "Pushpa2  3,08,52,004(28D)",
      "Devara     2,36,20,250",
      "Baahubali2   2,30,89,976",
      "Kalki2898AD  2,19,96,000",
    ],
    // Add other categories here...
  };

  const handleCategoryChange = (category) => {
    setSelectedCategory(category);
  };

  return (
    <div className="aptg-container">
      <Navbar />
      <div className="aptg-header">
        <h1>AP Town Grossers</h1>
        <p>Select a category to view the records.</p>
      </div>
      <div className="aptg-content">
        <div className="aptg-categories">
          <ul>
            {Object.keys(categories).map((category) => (
              <li
                key={category}
                className={category === selectedCategory ? "active" : ""}
                onClick={() => handleCategoryChange(category)}
              >
                {category}
              </li>
            ))}
          </ul>
        </div>
        <div className="aptg-records">
          {selectedCategory && (
            <div>
              <h2>{selectedCategory}</h2>
              <ul>
                {categories[selectedCategory].map((record, index) => (
                  <li key={index}>{record}</li>
                ))}
              </ul>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default APTG;
